import "./App.css";

function App() {
  const [weather, setWeather] = useState(null);
  const [city, setCity] = useState("");

  return (
    <div className="app">
       <Form setWeather={setWeather} city={city} setCity={setCity} />
      {weather && weather.cod !== 200 ? (
        <Error weather={weather} />
      ) : (
        <Weather weather={weather} />

      )}


    </div>
  );
}

export default App;
